function check(testCase) {
    const passed = testCase.expected === solve(testCase.input);
    console.log(passed ? 'OK' : 'FAIL', testCase);
    return passed;
}

function solve(input) {
    const forest = input.trim().split('\n');
    const bottom = forest.length;
    const width = forest[0].length;
    let [row, col] = [1,3];
    let trees = 0;
    while (row < bottom) {
        if (forest[row][col % width] === '#') {
            trees += 1
        }
        row += 1;
        col += 3;
    }
    return trees;
}

